import { makeTypedQueryFactory as $mkFactory } from "@prisma/client/runtime/library"
export const getSimilarNotes = /*#__PURE__*/ $mkFactory("\nSELECT n.*\nFROM \"Embedding\" e\nJOIN \"Note\" n\nON e.\"id\" = n.\"id\"\nWHERE (e.embedding <=> $1::vector) <= 0.5\nORDER BY e.embedding <=> $1::vector\nLIMIT 10;\n\n")
